import React, {useEffect, useRef, useState} from 'react';
import {
    Segment,
} from 'semantic-ui-react';
import Responsive from "semantic-ui-react/dist/commonjs/addons/Responsive";
import killerRules from "../img/Règles du Killer 2021 VpresqueF.pdf"
import { Document, Page, pdfjs } from "react-pdf";
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;


export default function Rules() {
    const [width, setWidth] = useState(0);

    useEffect(() => {
        setWidth(window.innerWidth)
    }, [])

    return (
        <div className="bodyDesktop">
            <Segment style={{marginTop: '20px'}}>
                <Responsive
                    as="div"
                    minWidth={1200}
                >
                    <Document
                        file={killerRules}
                    >
                            <Page pageNumber={1} width={0.6 * width - 35}/>
                            <Page pageNumber={2} width={0.6*width - 35}/>
                            <Page pageNumber={3} width={0.6*width - 35}/>
                            <Page pageNumber={4} width={0.6*width - 35}/>
                            <Page pageNumber={5} width={0.6*width - 35}/>
                            <Page pageNumber={6} width={0.6*width - 35}/>
                            <Page pageNumber={7} width={0.6*width - 35}/>
                            <Page pageNumber={8} width={0.6*width - 35}/>
                            <Page pageNumber={9} width={0.6*width - 35}/>
                            <Page pageNumber={10} width={0.6*width - 35}/>
                            <Page pageNumber={11} width={0.6*width - 35}/>
                            <Page pageNumber={12} width={0.6*width - 35}/>
                    </Document>
                </Responsive>
                <Responsive as="div" maxWidth={1200}>
                    <Document
                        file={killerRules}
                    >
                        <Page pageNumber={1} width={width - 35}/>
                        <Page pageNumber={2} width={width - 35}/>
                        <Page pageNumber={3} width={width - 35}/>
                        <Page pageNumber={4} width={width - 35}/>
                        <Page pageNumber={5} width={width - 35}/>
                        <Page pageNumber={6} width={width - 35}/>
                        <Page pageNumber={7} width={width - 35}/>
                        <Page pageNumber={8} width={width - 35}/>
                        <Page pageNumber={9} width={width - 35}/>
                        <Page pageNumber={10} width={width - 35}/>
                        <Page pageNumber={11} width={width - 35}/>
                        <Page pageNumber={12} width={width - 35}/>
                    </Document>
                </Responsive>
            </Segment>
            <div className="spacer"/>
        </div>
    );
}
